## findCalculatedMetrics_1

<a id="opIdfindCalculatedMetrics_1"></a>

`GET /calculatedmetrics`

*Retrieve many calculated metrics*

A calculated metric response will always include these default items: *id, name, description, rsid, owner, polarity, precision, type* 

Other attributes can be optionally requested through the 'expansion' field:

* *modified*: Date that the metric was last modified (ISO 8601)
* *definition*: Calculated metric definition as JSON object
* *compatibility*: Products that the metric is compatible with
* *reportSuiteName*: Also return the friendly Report Suite name for the RSID
* *tags*: Gives all existing tags associated with the calculated metric

For more information about calculated metrics go [here](https://github.com/AdobeDocs/analytics-2.0-apis/blob/master/calculatedmetrics.md)

<h3 id="findcalculatedmetrics_1-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|expansion|query|array[string]|false|Comma-delimited list of additional calculated metric metadata fields to include on response.|
|includeType|query|array[string]|false|Include additional calculated metrics not owned by user. The "all" option takes precedence over "shared"|
|dataIds|query|string|false|Filter list to only include calculated metrics tied to specified RSID list (comma-delimited)|
|ownerId|query|string|false|Filter list to only include calculated metrics owned by the specified loginId|
|filterByIds|query|string|false|Filter list to only include calculated metrics in the specified list (comma-delimited list of IDs) (this is the same as calculatedMetricFilter, and is overwritten by calculatedMetricFilter|
|toBeUsedInRsid|query|string|false|The data view where the calculated metric intended to be used.  This data view will be used to determine things like compatibility and permissions.  If it is not specified then the permissions will be calculated based on the union of all metrics authorized in all groups the user belongs to.  If the compatibility expansion is specified and toBeUsedInRsid is not then the compatibility returned is based off the compatibility from the last time the calculated metric was saved.|
|locale|query|string|false|Locale|
|favorite|query|boolean|false|Filter list to only include calculated metrics that are favorites|
|approved|query|boolean|false|Filter list to only include calculated metrics that are approved|
|pagination|query|string|false|return paginated results|
|limit|query|integer|false|Number of results per page|
|page|query|integer|false|Page number (base 0 - first page is "0")|
|sortDirection|query|string|false|Sort direction (ASC or DESC)|
|sortProperty|query|string|false|Property to sort by (name, modified_date, id is currently allowed)|

