## modifyShares_1

<a id="opIdmodifyShares_1"></a>

`PUT /componentmetadata/shares`

*Share components with users. WARNING: Authoritative; deletes/overwrites all pre-existing shares for the given components*

Create one/many shares for one/many components at once. For each component object in the passed list, the given shares will replace the current set of shares for each component. For example, if one of the components was previously shared with additional users, and that share is not passed in here, it will no longer be shared with them.<br>

