|startDate|query|string|false|Format: YYYY-MM-DD|
|endDate|query|string|false|Format: YYYY-MM-DD|
|searchAnd|query|string|false|Search terms that will be AND-ed together. Space delimited.|
|searchOr|query|string|false|Search terms that will be OR-ed together. Space delimited.|
|searchNot|query|string|false|Search terms that will be treated as NOT including. Space delimited.|
|searchPhrase|query|string|false|A full search phrase that will be searched for.|
|allowRemoteLoad|query|string|false|Controls if Oberon should remote load data.  Default behavior is true with fallback to false if remote data does not exist|
|includeOberonXml|query|boolean|false|Controls if Oberon XML should be returned in the response - DEBUG ONLY|
|lookupNoneValues|query|boolean|false|Controls None values to be included|
|limit|query|integer|false|Number of results per page|
